      fetch('http://localhost:5000/api/getAllPointHelp')
      .then(response=>response.json())
      .then(
        (result)=>{
            console.log(result)
          setbecData(result);
        },
      )
    },[]);
    


    
    return (
       
      
    
    <header className={s.header}>
            
            
       



            

